import './CostFilter.css';

function CostFilter() {
  return (
    <div className="CostFilter-container">
      <h2>Список расходов</h2>
      <select>
        <option>Пункт 1</option>
        <option>Пункт 2</option>
      </select>
    </div>
  );
}

export default CostFilter;
